import React, { useState, useEffect, useContext } from "react";
import { ResponsivePie } from "@nivo/pie";

import { ResponsiveLine } from '@nivo/line'

// make sure parent container have a defined height when using
// responsive component, otherwise height will be 0 and
// no chart will be rendered.
// website examples showcase many properties,
// you'll often use just a few of them.
const MyResponsiveLine = ({ data /* see data tab */ }) => (
    <div style={{ height: 450, backgroundColor: "white" }}>
    <ResponsiveLine
        data={data}
        margin={{ top: 50, right: 110, bottom: 50, left: 60 }}
        xScale={{ type: 'point' }}
        yScale={{ type: 'linear', min: 'auto', max: 'auto', stacked: true, reverse: false }}
        yFormat=" >-.2f"
        axisTop={null}
        axisRight={null}
        axisBottom={{
            orient: 'bottom',
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'transportation',
            legendOffset: 36,
            legendPosition: 'middle'
        }}
        axisLeft={{
            orient: 'left',
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'count',
            legendOffset: -40,
            legendPosition: 'middle'
        }}
        colors={{ scheme: 'nivo' }}
        pointSize={10}
        pointColor={{ theme: 'background' }}
        pointBorderWidth={2}
        pointBorderColor={{ from: 'serieColor' }}
        pointLabelYOffset={-12}
        enableArea={true}
        areaOpacity={0.5}
        useMesh={true}
        legends={[
            {
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 100,
                translateY: 0,
                itemsSpacing: 0,
                itemDirection: 'left-to-right',
                itemWidth: 80,
                itemHeight: 20,
                itemOpacity: 0.75,
                symbolSize: 12,
                symbolShape: 'circle',
                symbolBorderColor: 'rgba(0, 0, 0, .5)',
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemBackground: 'rgba(0, 0, 0, .03)',
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
    />
    </div>
)

function DonutBar() {
  const [reportData, setReportData] = useReport([]);
  const [instData, setInstData] = useState([]);
  const [barData, setBarData] = useState([]);
  const context = useContext(awscontext);
  useEffect(() => {
    if (context.userRole === "Super Admin") {
      setReportData("dashboardChart", "");
    } else {
      setReportData("instituteDashboardChart", "");
    }
  }, []); // eslint-disable-line react-hooks/exhaustive-deps

  useEffect(() => {
    if (reportData.length > 0) {
      prepareData();
    }
  }, [reportData]); // eslint-disable-line react-hooks/exhaustive-deps

  const prepareData = () => {
    const institutePiePre = [];
    const barDataPre = [];
    reportData.forEach((report) => {
      let liveExams = 0;
      report.Sessions.forEach((session) => {
        if (Date.parse(session.sessionDate) < new Date()) {
        } else {
          liveExams += 1;
        }
      });

      institutePiePre.push({
        id: report.instituteName,
        label: report.instituteName,
        value: report.Sessions.length,
      });

      barDataPre.push({
        institute: report.instituteName,
        totalSessionNum: report.Sessions.length,
        activeSessionNum: liveExams,
      });
    });
    setBarData(barDataPre);
    setInstData(institutePiePre);
  };

  return (
    <div className="row m-4">
      {context.userRole === "Super Admin" ? (
        <div className="col-6">
          <div className="container-fluid">
            <div className="container-fluid">
              <div className="card mt-4 mb-4 rounded">
                <div
                  className="card-header py-3 dark-blue"
                  style={{ fontFamily: "verdana" }}
                >
                  <h5>{i18n.t("Institute_List")}</h5>
                </div>
                <div className="card-body">
                  <div style={{ height: 450, backgroundColor: "white" }}>
                    <ResponsivePie
                      data={instData}
                      margin={{ top: 40, right: 80, bottom: 80, left: 80 }}
                      innerRadius={0.5}
                      padAngle={0.7}
                      cornerRadius={3}
                      activeOuterRadiusOffset={8}
                      colors={{ scheme: "accent" }}
                      borderWidth={2}
                      borderColor={{
                        from: "color",
                        modifiers: [["brighter", 0.2]],
                      }}
                      arcLinkLabelsSkipAngle={6}
                      arcLinkLabelsTextColor="#333333"
                      arcLinkLabelsThickness={2}
                      arcLinkLabelsColor="#766f6f"
                      arcLabelsSkipAngle={10}
                      arcLabelsTextColor={{
                        from: "color",
                        modifiers: [["darker", 2]],
                      }}
                      defs={[
                        {
                          id: "dots",
                          type: "patternDots",
                          background: "inherit",
                          color: "rgba(255, 255, 255, 0.3)",
                          size: 4,
                          padding: 1,
                          stagger: true,
                        },
                        {
                          id: "lines",
                          type: "patternLines",
                          background: "inherit",
                          color: "rgba(255, 255, 255, 0.3)",
                          rotation: -45,
                          lineWidth: 6,
                          spacing: 10,
                        },
                      ]}
                      fill={[
                        {
                          match: {
                            id: "ruby",
                          },
                          id: "dots",
                        },
                        {
                          match: {
                            id: "c",
                          },
                          id: "dots",
                        },
                        {
                          match: {
                            id: "go",
                          },
                          id: "dots",
                        },
                        {
                          match: {
                            id: "python",
                          },
                          id: "dots",
                        },
                        {
                          match: {
                            id: "scala",
                          },
                          id: "lines",
                        },
                        {
                          match: {
                            id: "lisp",
                          },
                          id: "lines",
                        },
                        {
                          match: {
                            id: "elixir",
                          },
                          id: "lines",
                        },
                        {
                          match: {
                            id: "javascript",
                          },
                          id: "lines",
                        },
                      ]}
                      transitionMode="startAngle"
                      legends={[]}
                    />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      ) : (
        ""
      )}

      <div className="col-6">
        <div className="container-fluid">
          <div className="container-fluid">
            <div className="card mt-4 mb-4">
              <div
                className="card-header py-3 dark-blue"
                style={{ fontFamily: "verdana" }}
              >
                <h5>{i18n.t("Session_List")}</h5>
              </div>
              <div className="card-body">
                <div style={{ height: 450, backgroundColor: "white" }}>
                  <ResponsiveBar
                    data={barData}
                    keys={["totalSessionNum", "activeSessionNum"]}
                    keyNames={["Total Sessions", "Active Sessions"]}
                    indexBy="institute"
                    margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
                    padding={0.3}
                    valueScale={{ type: "linear" }}
                    indexScale={{ type: "band", round: true }}
                    valueFormat={{ format: "", enabled: false }}
                    colors={{ scheme: "paired" }}
                    defs={[
                      {
                        id: "dots",
                        type: "patternDots",
                        background: "inherit",
                        color: "#38bcb2",
                        size: 4,
                        padding: 1,
                        stagger: true,
                      },
                      {
                        id: "lines",
                        type: "patternLines",
                        background: "inherit",
                        color: "#eed312",
                        rotation: -45,
                        lineWidth: 6,
                        spacing: 10,
                      },
                    ]}
                    fill={[
                      {
                        match: {
                          id: "fries",
                        },
                        id: "dots",
                      },
                      {
                        match: {
                          id: "sandwich",
                        },
                        id: "lines",
                      },
                    ]}
                    borderRadius={5}
                    borderWidth={2}
                    borderColor={{ theme: "background" }}
                    axisTop={null}
                    axisRight={null}
                    axisBottom={{
                      tickSize: 5,
                      tickPadding: 5,
                      tickRotation: 0,
                      legend: "Institute",
                      legendPosition: "middle",
                      legendOffset: 32,
                    }}
                    axisLeft={{
                      tickSize: 5,
                      tickPadding: 5,
                      tickRotation: 0,
                      legend: "Count",
                      legendPosition: "middle",
                      legendOffset: -40,
                    }}
                    labelSkipWidth={13}
                    labelSkipHeight={9}
                    labelTextColor={{
                      from: "color",
                      modifiers: [["darker", "1.6"]],
                    }}
                    legends={[
                      {
                        dataFrom: "keys",
                        anchor: "bottom-right",
                        direction: "column",
                        justify: false,
                        translateX: 120,
                        translateY: 0,
                        itemsSpacing: 2,
                        itemWidth: 100,
                        itemHeight: 20,
                        itemDirection: "left-to-right",
                        itemOpacity: 0.85,
                        symbolSize: 20,
                        effects: [
                          {
                            on: "hover",
                            style: {
                              itemOpacity: 1,
                            },
                          },
                        ],
                      },
                    ]}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default withNamespaces()(DonutBar);
